                        <span>日期</span><input onChange={this.dataChange('day')}></input><br />
                        <span>任务</span><input onChange={this.dataChange('thing')}></input><br />
                        <span>时间</span><input ></input><br />
                        <button onClick={this.subMit}>添加</button>
                    </form>
                    <div className='search'>
                        <input type='text' onChange={this.searchT}></input><span onClick={this.search}>搜索</span>
                    </div>
            </div>
        )
    }
}

